import Vue from 'vue'
import App from './App.vue'
import vuetify from './plugins/vuetify'
import store from './store/app.js' // Update the import path
import router from './router/index.js' // Update the import path


Vue.config.productionTip = false

new Vue({
  vuetify,
  render: h => h(App),
  store: new Vuex.store({
    modules: {
      app: store,
    }
  }),
  router,
}).$mount('#app')
